import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import AutoLayout from '../components/AutoLayout';
import '../style/style.css';

const ApplicationBox = ({ title, description, imageUrl, liveLink, githubLink }) => {
  return (
    <Col md={4} sm={6}>
      <div className="application-box">
        <img src={imageUrl} alt={title} />
        <h3>{title}</h3>
        <p>{description}</p>
        <div className="button-group">
          <a href={liveLink} target="_blank" rel="noopener noreferrer">
            <button className="btn btn-primary">Live Demo</button>
          </a>
          <a href={githubLink} target="_blank" rel="noopener noreferrer">
            <button className="btn btn-secondary">GitHub</button>
          </a>
        </div>
      </div>
    </Col>
  );
};

const Home = () => {
  return (
    <AutoLayout>
      <Container>
        {/* Section 1 */}
        {/* ... */}

        {/* Section 2 */}
        <Row id="section2" className="section">
          <Col>
            <h2 style={{ fontWeight: 'bold' }}>Portfolio</h2>
            <Row>
              {/* Application 1 */}
              <ApplicationBox
                title="Application 1"
                description="Description of Application 1"
                imageUrl="/path/to/image-1.png" // Replace with the actual image URL
                liveLink="https://www.example.com/app-1" // Replace with the actual live link
                githubLink="https://github.com/username/app-1" // Replace with the actual GitHub repository link
              />

              {/* Application 2 */}
              <ApplicationBox
                title="Application 2"
                description="Description of Application 2"
                imageUrl="/path/to/image-2.png" // Replace with the actual image URL
                liveLink="https://www.example.com/app-2" // Replace with the actual live link
                githubLink="https://github.com/username/app-2" // Replace with the actual GitHub repository link
              />

              {/* Add more application boxes here */}
              {/* Application 3 */}
              <ApplicationBox
                title="Application 3"
                description="Description of Application 3"
                imageUrl="/path/to/image-3.png" // Replace with the actual image URL
                liveLink="https://www.example.com/app-3" // Replace with the actual live link
                githubLink="https://github.com/username/app-3" // Replace with the actual GitHub repository link
              />

              {/* Application 4 */}
              <ApplicationBox
                title="Application 4"
                description="Description of Application 4"
                imageUrl="/path/to/image-4.png" // Replace with the actual image URL
                liveLink="https://www.example.com/app-4" // Replace with the actual live link
                githubLink="https://github.com/username/app-4" // Replace with the actual GitHub repository link
              />

              {/* Application 5 */}
              <ApplicationBox
                title="Application 5"
                description="Description of Application 5"
                imageUrl="/path/to/image-5.png" // Replace with the actual image URL
                liveLink="https://www.example.com/app-5" // Replace with the actual live link
                githubLink="https://github.com/username/app-5" // Replace with the actual GitHub repository link
              />

              {/* Application 6 */}
              <ApplicationBox
                title="Application 6"
                description="Description of Application 6"
                imageUrl="/path/to/image-6.png" // Replace with the actual image URL
                liveLink="https://www.example.com/app-6" // Replace with the actual live link
                githubLink="https://github.com/username/app-6" // Replace with the actual GitHub repository link
              />
            </Row>
          </Col>
        </Row>

        {/* Section 3 */}
        {/* ... */}

        {/* Section 4 */}
        {/* ... */}
      </Container>
      {/* Your additional content goes here */}
    </AutoLayout>
  );
};

export default Home;
